// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract V3Marksheet {
    struct Student {
        string name;
        uint english;
        uint hindi;
        uint math;
        uint percentage; // inherited from V1
        uint science;    // added in V2
        bool isPass;     // added in V3
    }

    mapping(uint => Student) internal students;

    /// @notice Add or update a student record
    function addOrUpdateStudent(
        uint id,
        string memory name,
        uint english,
        uint hindi,
        uint math,
        uint science
    ) public {
        require(english <= 100, "English marks must be <= 100");
        require(hindi <= 100, "Hindi marks must be <= 100");
        require(math <= 100, "Math marks must be <= 100");
        require(science <= 100, "Science marks must be <= 100");

        uint total = english + hindi + math + science;
        uint percentage = (total * 100) / 400;
        bool isPass = percentage >= 60;

        students[id] = Student({
            name: name,
            english: english,
            hindi: hindi,
            math: math,
            percentage: percentage,
            science: science,
            isPass: isPass
        });
    }

    /// @notice Update only science marks for an existing student and re-calculate percentage/pass
    function updateScienceMarks(uint id, uint science) public {
        require(science <= 100, "Science marks must be <= 100");

        Student storage s = students[id];

        s.science = science;

        uint total = s.english + s.hindi + s.math + s.science;
        s.percentage = (total * 100) / 400;
        s.isPass = s.percentage >= 60;
    }

    /// @notice View full student data
    function getStudent(uint id) public view returns (
        string memory name,
        uint english,
        uint hindi,
        uint math,
        uint science,
        uint percentage,
        bool isPass
    ) {
        Student storage s = students[id];
        return (
            s.name,
            s.english,
            s.hindi,
            s.math,
            s.science,
            s.percentage,
            s.isPass
        );
    }
}

